    "we-theme-pratt/eventHome": "<div id=\"headerwrap\">\n  <div class=\"container\">\n    <div class=\"row centered\">\n      <div class=\"col-lg-12\">\n        <h1>{{event.title}}</h1>\n        <h3>@{{event.abbreviation}}</h3>\n        <br>\n      </div>\n      <div class=\"col-lg-2\">\n        <p>\n          <strong>{{t 'form-event-about-location'}}</strong><br>\n          {{event.location}}\n        </p>\n        <p class=\"home-event-date\">\n          {{#with event}}\n            <strong>{{t 'event.dates'}}:</strong> <br>\n            {{we-cf-date-range start=eventStartDate end=eventEndDate __=../__}}\n          {{/with}}\n        </p>\n        {{#if event.vacancies}}\n          <h5>{{t 'form-event-about-vacancies'}}</h5>\n          <p>{{event.vacancies}}</p>\n        {{/if}}\n        <img class=\"hidden-xs hidden-sm hidden-md\" src=\"/public/theme/we-theme-pratt/img/arrow1.png\" alt=\"An arrow image pointing to example image\">\n      </div>\n      <div class=\"col-lg-8\">\n        {{#each event.banner}}\n          {{{we-image this 'original' class=\"hidden-xs hidden-sm hidden-md img-responsive\"}}}\n        {{/each}}\n      </div>\n      <div class=\"col-lg-2\">\n        <img class=\"hidden-xs hidden-sm hidden-md\" src=\"/public/theme/we-theme-pratt/img/arrow2.png\" alt=\"An arrow image pointing to example image\">\n        <p>\n          {{#with event}}\n            {{#if callForPapersStartDate}}\n              <strong>{{t 'event.callForPapersDates'}}:</strong> {{we-cf-date-range start=callForPapersStartDate end=callForPapersEndDate __=../__}}\n              <br>\n            {{/if}}\n            <strong>{{t 'event.registrationDates'}}:</strong>  {{we-cf-date-range start=registrationStartDate end=registrationEndDate __=../__}}\n          {{/with}}\n        </p>\n        <h5>\n          {{#with event}}\n            {{{template 'event/event-status-label'}}}\n          {{/with}}\n        </h5>\n        <p>\n          {{we-cf-registration-btn class=\"btn btn-block btn-lg\" event=event locals=this userCfregistration=userCfregistration}}\n        </p>\n      </div>\n    </div>\n  </div>\n</div>\n\n<div class=\"container\">\n  {{#region 'highlighted'}}{{/region}}\n  <div id=\"sysMessagesArea\">{{{we-messages}}}</div>\n  <section id=\"about\">\n    <div id=\"content\" role=\"main\" class=\"about-content\">\n      {{{body}}}\n    </div>\n  </section>\n  {{#region 'afterContent'}}{{/region}}\n</div>",
    "we-theme-admin-default/default": "<div id=\"page-wrapper\" style=\"min-height: 160px;\">\n  <div class=\"row\">\n    <div class=\"col-lg-12\">\n      <ol class=\"ember-view breadcrumbs breadcrumb\">\n        <li class=\"first current\">\n          {{#link-to 'admin.index' }}{{t 'home'}}{{/link-to}}\n        </li>\n      </ol>\n\n      {{#unless skipLayoutTitle}}{{#if title}}\n        <h1 class=\"page-header\">{{title}}</h1>\n      {{/if}}{{/unless}}\n\n      <div id=\"sysMessagesArea\">{{{we-messages}}}</div>\n      <div id=\"content\" role=\"main\">{{{body}}}</div>\n    </div>\n  </div>\n</div>"
