    "forms/html": "<div class=\"form-group {{#if error}}has-error has-feedback{{/if}}\">\n  <label for=\"{{fieldId}}\">{{t fieldName}} {{#ifCond field.allowNull false}}*{{/ifCond}}</label>\n  <p class=\"help-block\">{{t help}}</p>\n  <span class=\"help-block\">{{error.message}}</span>\n  <textarea id=\"{{fieldId}}\" name=\"{{name}}\" we-editor-height=\"{{field.formFieldHeight}}\" we-editor-focus=\"{{field.formFieldFocus}}\" we-editor-minheight=\"{{field.formFieldMinHeight}}\" we-editor-maxheight=\"{{field.formFieldMaxHeight}}\" class=\"form-control\">{{value}}</textarea>\n\n  {{{field-help-error error}}}\n</div>\n\n<script>$(document).ready(function() {\n  we.components.editor.init('#{{fieldId}}');\n});</script>",
    "cfcontact/create": "{{#if messageSend }}\n\t{{t 'event.cfcontact.send'}}\n{{else}}\n  {{{form 'cfcontact' data validationError}}}\n{{/if}}",
    "cfcontact/find": "<div class=\"row\">\n  <div class=\"col-lg-12\">\n    <table class=\"table table-striped table-hover\">\n      <thead>\n        <tr>\n          <th>id</th>\n          <th>{{t 'name'}}</th>\n          <th>{{t 'status'}}</th>\n          <th>{{t 'createdAt'}}</th>\n          <th>{{t 'actions'}}</th>\n        </tr>\n      </thead>\n      <tbody>\n      {{#each data}}\n        <tr class=\"{{statusClass}}\">\n          <td>{{id}}</td>\n          <td>{{name}}</td>\n          <td>{{status}}</td>\n          <td>{{we-date createdAt }}</td>\n          <td>\n            <form class=\"form form-inline\" action=\"{{../req.path}}/{{id}}/edit\" method=\"post\" style=\"display: inline;\">\n              <input type=\"hidden\" name=\"redirectTo\" value=\"{{../req.path}}\">\n              {{#ifCond status 'closed'}}\n                <div class=\"form-group\">\n                  <button name=\"status\" value=\"opened\" type=\"submit\" class=\"btn btn-sm btn-default\">{{t 'cfcontact.open'}}</button>\n                </div>\n              {{else}}\n                <div class=\"form-group\">\n                  <button name=\"status\" value=\"closed\" type=\"submit\" class=\"btn btn-sm btn-default\">{{t 'cfcontact.close'}}</button>\n                </div>\n              {{/ifCond}}\n            </form>\n            {{ we-action-view-btn 'cfcontact' this ../req eventId id }}\n            {{ we-action-delete-btn 'cfcontact' this ../req eventId id }}\n          </td>\n        </tr>\n      {{/each}}\n      </tbody>\n      <tfoot>\n        <tr>\n          <td colspan=\"4\">\n            {{paginate count=metadata.count limit=query.limit currentPage=query.page req=req}}\n          </td>\n        </tr>\n      </tfoot>\n    </table>\n  </div>\n</div>",
    "cfcontact/findOne": "\n\n<div class=\"row\">\n  <div class=\"col-lg-12\">\n    <form class=\"form\" action=\"{{req.path}}/edit\" method=\"post\">\n      <input type=\"hidden\" name=\"redirectTo\" value=\"{{req.path}}\">\n      {{#ifCond data.status 'closed'}}\n        <div class=\"form-group\">\n          <button name=\"status\" value=\"closed\" type=\"submit\" class=\"btn btn-default\">{{t 'cfcontact.open'}}</button>\n        </div>\n      {{else}}\n        <div class=\"form-group\">\n          <button name=\"status\" value=\"closed\" type=\"submit\" class=\"btn btn-default\">{{t 'cfcontact.close'}}</button>\n        </div>\n      {{/ifCond}}\n    </form>\n  </div>\n  <div class=\"col-lg-12\">\n    <div class=\"panel panel-default\">\n      <div class=\"panel-body\">\n        <div class=\"form-group\">\n          <label for=\"createdAt\" class=\"control-label\">Data Criação</label>\n          <p class=\"form-control-static\">{{we-date data.createdAt }}</p>\n        </div>\n        <div class=\"form-group\">\n          <label for=\"name\" class=\"control-label\">Nome</label>\n          <p class=\"form-control-static\">{{ data.name }}</p>\n        </div>\n        <div class=\"form-group\">\n          <label for=\"email\" class=\"control-label\">Email</label>\n          <p class=\"form-control-static\">{{ data.email }}</p>\n        </div>\n        <div class=\"form-group\">\n          <label for=\"status\" class=\"control-label\">Status</label>\n          <p class=\"form-control-static\">{{ data.status }}</p>\n        </div>\n        <div class=\"form-group\">\n          <label for=\"message\" class=\"control-label\">Mensagem</label>\n          <p class=\"form-control-static\">{{ data.message }}</p>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>",
    "cfnews/find": "<div class=\"row\"><div class=\"col-lg-12 actions\">{{we-action-create-btn model req event.id}}</div></div>\n\n{{#each data}}\n<article class=\"teaser\">\n  <div class=\"article-meta\">\n    {{t 'Updated at'}} <time datetime=\"{{createdAt}}\"><strong>{{we-date updatedAt}}</strong></time>  {{#each categories}} {{t 'category'}}: <strong>{{this}}</strong>{{/each}}\n  </div>\n\n  {{#each featuredImage}}{{{we-image this 'medium' class=\"article-featured-image thumbnail\"}}}{{/each}}\n\n  <h2 class=\"teaser-title\">{{#link-to 'cfnews.findOne' eventId id}}{{title}}{{/link-to}}</h2>\n\n  {{{teaser}}}\n\n  <div class=\"clearfix\"></div>\n  <footer class=\"article-actions\">\n    {{we-action-view-btn 'cfnews' this ../req eventId id }}\n    {{we-action-edit-btn 'cfnews' this ../req eventId id }}\n    {{we-action-delete-btn 'cfnews' this ../req eventId id }}\n  </footer>\n</article>\n{{else}}\n  <p> {{t 'event.cfnews.empty'}}</p>\n{{/each}}",
    "cfnews/findOne": "<article>\n  <header>\n    <div class=\"article-meta\">\n      {{t 'Updated at'}} <time datetime=\"{{data.createdAt}}\"><strong>{{we-date data.updatedAt}}</strong></time> -\n      {{#each data.categories}} {{t 'category'}}: <strong>{{this}}</strong>{{/each}}\n    </div>\n\n  </header>\n\n  {{#each data.featuredImage}}{{{we-image this 'medium' class=\"article-featured-image thumbnail\"}}}{{/each}}\n  {{{data.text}}}\n\n  <footer>\n    <div class=\"row\"><div class=\"col col-md-12\">{{{we-terms data.tags}}}</div></div>\n    <div class=\"row actions\"><div class=\"col col-md-12\">\n      {{we-action-edit-btn model data req data.eventId id }}\n      {{we-action-delete-btn model data req data.eventId id }}\n    </div></div>\n  </footer>\n\n</article>",
